<template><div>    <chat-list :chat-list="ChatList"></chat-list></div></template><script>var ChatList = require('../components/ChatList.vue');export default {    components : {        'chat-list' : ChatList    },    created:function(){        this.getChatList();    },    computed : {        ChatList : function(){            return this.$store.getters.getChatList        }    },    methods : {        getChatList : function(){            this.$http.get('src/static/data.json').then(function(res){                console.log(res.data)                this.$store.commit('setChatList',res.data);            },function(res){                console.log(res.status)            })        }    }}</script><style></style>